import { useState } from "react";


function Login() {

    const {email, password} = useState();
    

    return (<>
    <form methos="POST">
        <input type="email" placeholder='Enter your email' />
        <input type="password" placeholder='Enter your password'/>
        <button>Login</button>
    </form>
    </>);
}

export default Login;
